package Lab10_NestedForLoops_WhileLoops;

public class JUNK2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		

		for (int i = 1; i<=9; i++) // prints second for loop that amount of times (how many rows)
		
		{
			for (int j = 1; j<=9; j++) // row because print and not print ln // inside loop
			{
				System.out.print(i*j + " ");
			}
			
			System.out.println();
		}
		
	}

}
